import React from 'react';
import { WiDayCloudyGusts } from "react-icons/wi";

function Navbar() {
    return (
        <div className="sticky top-0 m-0 flex justify-between max-w-7xl mx-auto z-99 text-stone-300 items-center bg-header-primary">
            <div className='flex flex-row justify-between items-center p-2 '>
                <WiDayCloudyGusts size={50} /><span className='text-lg font-semibold'>&nbsp;Daily Weather App</span>
            </div>
            <p className="text-center text-xl tracking-widest font-serif items-center p-2 cursor-pointer uppercase">
                {new Date().toDateString()}
            </p>
        </div>
    )
}

export default Navbar
